// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract ZyraStaking is ReentrancyGuard, Ownable {
    using SafeMath for uint256;

    IERC20 public token;
    
    struct Stake {
        uint256 amount;
        uint256 timestamp;
        uint256 lastRewardClaim;
    }
    
    mapping(address => Stake) public stakes;
    uint256 public rewardRate = 10; // 10% APY
    uint256 public constant YEAR = 365 days;
    
    event Staked(address indexed user, uint256 amount);
    event Unstaked(address indexed user, uint256 amount);
    event RewardClaimed(address indexed user, uint256 amount);

    constructor(address _token) {
        require(_token != address(0), "Token address cannot be 0");
        token = IERC20(_token);
    }

    function stake(uint256 _amount) external nonReentrant {
        require(_amount > 0, "Amount must be > 0");
        
        // Transfer tokens to contract
        require(token.transferFrom(msg.sender, address(this), _amount), "Transfer failed");
        
        // Update stake
        if (stakes[msg.sender].amount > 0) {
            claimReward(); // Claim any pending rewards before updating stake
        }
        
        stakes[msg.sender].amount = stakes[msg.sender].amount.add(_amount);
        stakes[msg.sender].timestamp = block.timestamp;
        stakes[msg.sender].lastRewardClaim = block.timestamp;
        
        emit Staked(msg.sender, _amount);
    }

    function unstake(uint256 _amount) external nonReentrant {
        require(_amount > 0, "Amount must be > 0");
        require(stakes[msg.sender].amount >= _amount, "Insufficient stake");
        
        claimReward(); // Claim rewards before unstaking
        
        stakes[msg.sender].amount = stakes[msg.sender].amount.sub(_amount);
        require(token.transfer(msg.sender, _amount), "Transfer failed");
        
        emit Unstaked(msg.sender, _amount);
    }

    function claimReward() public {
        uint256 reward = calculateReward(msg.sender);
        if (reward > 0) {
            stakes[msg.sender].lastRewardClaim = block.timestamp;
            require(token.transfer(msg.sender, reward), "Reward transfer failed");
            emit RewardClaimed(msg.sender, reward);
        }
    }

    function calculateReward(address _staker) public view returns (uint256) {
        Stake memory stake = stakes[_staker];
        if (stake.amount == 0) return 0;
        
        uint256 timeElapsed = block.timestamp.sub(stake.lastRewardClaim);
        return stake.amount
            .mul(rewardRate)
            .mul(timeElapsed)
            .div(YEAR)
            .div(100);
    }

    function setRewardRate(uint256 _newRate) external onlyOwner {
        require(_newRate <= 100, "Rate too high"); // Max 100% APY
        rewardRate = _newRate;
    }

    function getStakeInfo(address _staker) external view returns (
        uint256 amount,
        uint256 timestamp,
        uint256 lastRewardClaim,
        uint256 pendingRewards
    ) {
        Stake memory stake = stakes[_staker];
        return (
            stake.amount,
            stake.timestamp,
            stake.lastRewardClaim,
            calculateReward(_staker)
        );
    }
}

