// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ZyraToken is ERC20, Ownable {
    constructor() ERC20("ZYRA", "ZYRA") {
        // Mint 1 billion tokens with 18 decimals (1,000,000,000 * 10^18)
        _mint(msg.sender, 1000000000 * 10**decimals());
    }

    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

    function burn(uint256 amount) public {
        _burn(msg.sender, amount);
    }
}

contracts/ZyraVesting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract ZyraVesting is Ownable {
    using SafeMath for uint256;

    struct VestingSchedule {
        bool initialized;
        address beneficiary;
        uint256 cliff;
        uint256 start;
        uint256 duration;
        uint256 totalAmount;
        uint256 released;
    }

    IERC20 public token;
    mapping(address => VestingSchedule) public vestingSchedules;
    
    event TokensVested(address indexed beneficiary, uint256 amount);
    event VestingScheduleCreated(address indexed beneficiary, uint256 amount);

    constructor(address _token) {
        require(_token != address(0), "Token address cannot be 0");
        token = IERC20(_token);
    }

    function createVestingSchedule(
        address _beneficiary,
        uint256 _start,
        uint256 _cliff,
        uint256 _duration,
        uint256 _totalAmount
    ) external onlyOwner {
        require(vestingSchedules[_beneficiary].initialized == false, "Schedule exists");
        require(_duration > 0, "Duration must be > 0");
        require(_totalAmount > 0, "Amount must be > 0");
        
        token.transferFrom(msg.sender, address(this), _totalAmount);
        
        vestingSchedules[_beneficiary] = VestingSchedule({
            initialized: true,
            beneficiary: _beneficiary,
            cliff: _start.add(_cliff),
            start: _start,
            duration: _duration,
            totalAmount: _totalAmount,
            released: 0
        });

        emit VestingScheduleCreated(_beneficiary, _totalAmount);
    }

    function release() external {
        VestingSchedule storage schedule = vestingSchedules[msg.sender];
        require(schedule.initialized, "No vesting schedule");
        require(block.timestamp >= schedule.cliff, "Cliff not reached");

        uint256 vested = vestedAmount(msg.sender);
        require(vested > 0, "Nothing to release");

        schedule.released = schedule.released.add(vested);
        token.transfer(msg.sender, vested);

        emit TokensVested(msg.sender, vested);
    }

    function vestedAmount(address _beneficiary) public view returns (uint256) {
        VestingSchedule storage schedule = vestingSchedules[_beneficiary];
        if (!schedule.initialized) return 0;
        if (block.timestamp < schedule.cliff) return 0;
        if (block.timestamp >= schedule.start.add(schedule.duration)) {
            return schedule.totalAmount.sub(schedule.released);
        }
        
        uint256 timeFromStart = block.timestamp.sub(schedule.start);
        return schedule.totalAmount
            .mul(timeFromStart)
            .div(schedule.duration)
            .sub(schedule.released);
    }
}

